import React from 'react';
import User from './User';

const Users = ({props}) => {
    return(
        <div>
            {
                props.map( (element, i) => {
                    return <User 
                    name={users[i].name} 
                    username={users[i].username}
                    email={users[i].email}
                    /> 
                })
            }
        </div>
    );
}

export default Users;
